from icontract import require, ensure, DBC


class UnweightedAdjacencyList(DBC):
    def __init__(self) -> None:
        self.adjacency: List[List[int]] = []

    def connect(self, first_node: int, second_node: int) -> None:
        require(first_node >= 0)
        require(second_node >= 0)

        if first_node > len(self.adjacency) - 1:
            self.adjacency.extend([[] for _ in range(first_node - len(self.adjacency) + 1)])

        self.adjacency[first_node].append(second_node)

    def disconnect(self, first_node: int, second_node: int) -> None:
        require(first_node >= 0)
        require(second_node >= 0)

        try:
            self.adjacency[first_node].remove(second_node)
        except ValueError:
            pass

    def query(self, first_node: int) -> List[int]:
        require(first_node >= 0)

        if first_node >= len(self.adjacency):
            return []

        return self.adjacency[first_node]


