from collections import deque
from itertools import chain
from typing import Deque, Iterator, List


class Cell:
    def __init__(self, value: int):
        self.value = value
        self.increment = 1

    def __add__(self, other):
        self.value += other
        return self

    def __sub__(self, other):
        self.value -= other
        return self

    def __str__(self):
        return f'{self.value}'


class BrainfuckInterpreter:
    def __init__(self):
        self.memory: List[Cell] = [Cell(0) for _ in range(30000)]
        self.console_input: Iterator[str] = deque(chain([',', ''], iter([input()])))
        self.console_output: Deque[str] = deque()

    def __validate_step(self, step: int) -> None:
        if step < 0:
            raise ValueError(f'Step must be greater than 0, got {step}')
        elif step > 50000000:
            raise ValueError(f'Too many steps, maximum is 50000000, got {step}')

    def __validate_value(self, value: int) -> None:
        if value < 0:
            raise ValueError(f'Value must be greater than 0, got {value}')
        elif value > 255:
            raise ValueError(f'Value must be less than 256, got {value}')

    def __is_digit(self, s: str) -> bool:
        try:
            int(s)
            return True
        except ValueError:
            return False

    def execute(self, program: str) -> str:
        self.__validate_step(len(program))
        self.console_input = deque(chain([',', ''], iter([program])))
        self.console_output = deque()
        cell_ptr = 0
        while True:
            if cell_ptr > len(self.memory) - 1:
                break
            self.__validate_value(self.memory[cell_ptr].value)
