import sys


class BinarySearchTreeNode:
    def __init__(self, key, value, left=None, right=None, parent=None):
        self.key = key
        self.value = value
        self.left = left
        self.right = right
        self.parent = parent

    def insert(self, key, value):
        if key < self.key:
            if self.left is None:
                self.left = BinarySearchTreeNode(key, value)
                return self.left
            else:
                return self.left.insert(key, value)
        elif key > self.key:
            if self.right is None:
                self.right = BinarySearchTreeNode(key, value)
                return self.right
            else:
                return self.right.insert(key, value)

    def find(self, key):
        if key < self.key:
            if self.left is None:
                return None
            else:
                return self.left.find(key)
        elif key > self.key:
            if self.right is None:
                return None
            else:
                return self.right.find(key)
        else:
            return self

    def delete(self, key):
        if key < self.key:
            if self.left is None:
                return None
            else:
                return self.left.delete(key)
        elif key > self.key:
            if self.right is None:
                return None
            else:
                return self.right.delete(key)
        else:
            if self.left is None and self.right is None:
                if self.parent is not None:
                    if self.parent.left == self:
                        self.parent.left = None
                    else:
                        self.parent.right = None
                    return self.parent
                else:
                    return None
            elif self.right is None:
                self.key = self.left.key
                self.value = self.left.value
                self.left = self.left.left
                return self
            elif self.left is None:
                self.key = self.right.key
                self.value = self.right.value
                self.right = self.right.right
                return self
            else:
                successor = self.right.findMin()
                self.key = successor.key
                self.value = successor.value
                self.delete(successor.key)
                return self

    def findMin(self):
        if self.left is None:
            return self
        else:
            return self.left.findMin()

