import collections


class BinaryIndexedTree:
    def __init__(self, n):
        self.bit = [0] * (n + 1)

    def build(self, array):
        for i, x in enumerate(array):
            self.update(i + 1, x)

    def update(self, i, x):
        while i <= len(self.bit):
            self.bit[i] += x
            i += i & -i

    def sum(self, i):
        s = 0
        while i:
            s += self.bit[i]
            i -= i & -i
        return s


class Solution:
    def solve(self, a):
        res = []
        n = len(a)
        bit = BinaryIndexedTree(n)
        bit.build(a)
        for i in range(1, n + 1):
            res.append(bit.sum(i))

        return res


