from typing import Deque, Dict, List, Tuple


class Node:
    def __init__(self, value: int) -> None:
        self.value: int = value
        self.edges: List[Node] = []


class Edge:
    def __init__(self, u: Node, v: Node, weight: int) -> None:
        self.u: Node = u
        self.v: Node = v
        self.weight: int = weight


class Graph:
    def __init__(self) -> None:
        self.nodes: Dict[int, Node] = {}
        self.edges: Dict[Tuple[int, int], Edge] = {}

    def add_edge(self, u: int, v: int, weight: int) -> None:
        if u not in self.nodes:
            self.nodes[u] = Node(u)
        if v not in self.nodes:
            self.nodes[v] = Node(v)
        edge: Edge = Edge(self.nodes[u], self.nodes[v], weight)
        self.nodes[u].edges.append(edge)
        self.nodes[v].edges.append(edge)
        self.edges[(u, v)] = edge
        self.edges[(v, u)] = edge

    def add_node(self, value: int) -> None:
        if value not in self.nodes:
            self.nodes[value] = Node(value)

    def bfs(self, start: int, end: int) -> List[Node]:
        queue: Deque[Node] = deque([self.nodes[start]])
        distance: Dict[int, int] = {start: 0}
        while queue:
            node: Node = queue.popleft()
            for edge in node.edges:
                if edge.v.value not in distance or distance[edge.v.value] > distance[node.value] + edge.weight:
                    distance[edge.v.value] = distance[node.value] + edge.weight
                    queue.append(edge.v)
        return distance[end] if end in distance else -1

    def dijkstra(self, start: int, end: int) -> List[Node]:
        if start not in self.nodes or end not in self.nodes:
            return -1
        distance: Dict[int, int] = {start: 0}
        queue: Deque[Tuple[int, Node]] = deque([(start, self.nodes[start])])
        while queue:
            distance, node = queue.popleft()
            for edge in node.edges:
                new_distance: int = distance + edge.weight
                if edge.v.value not in distance or new_distance < distance[edge.v.value]:
                    distance[edge.v.value] = new_distance
                    queue.append((new_distance, edge.v))
        return distance[end] if end in distance else -1

    def shortest_path(self, start: int, end: int) -> int:
        if start not in self.nodes or end not in self.nodes:
            return -1
        distance: List[int] = [inf] * (len(self.nodes) + 1)
        queue: Deque[Tuple[int, Node]] = deque([(start, self.nodes[start])])
        distance[start] = 0
        while queue:
            distance, node = queue.popleft()
            for edge in node.edges:
                new_distance: int = distance + edge.weight
                if edge.v.value not in distance or new_distance < distance[edge.v.value]:
                    distance[edge.v.value] = new_distance
                    queue.append((new_distance, edge.v))
        return distance[end] if end in distance else -1


