import collections

class MazeSolver:
    def __init__(self, input_file_name):
        with open(input_file_name, "r") as f:
            first_line = f.readline().split()
            self.time = int(first_line[0])
            self.width = int(first_line[1])
            self.height = int(first_line[2])
            self.input = [line.strip() for line in f.readlines()]
            self.grid = [[] for _ in range(self.height)]
            for i, row in enumerate(self.input):
                for j, col in enumerate(row):
                    if col == "1":
                        self.grid[i].append(1)
                    elif col == "0":
                        self.grid[i].append(0)
                    elif col == "S":
                        self.start_point = (i, j)
                    elif col == "U":
                        self.up_points.append((i, j))
                    elif col == "D":
                        self.down_points.append((i, j))
                    elif col == "L":
                        self.left_points.append((i, j))
                    elif col == "R":
                        self.right_points.append((i, j))

    def solve(self):
        queue = collections.deque()
        queue.append(self.start_point)
        distance = {self.start_point: 0}
        parent = {self.start_point: None}
        while queue:
            current_point = queue.popleft()
            for direction in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
                neighbor = (current_point[0] + direction[0], current_point[1] + direction[1])
                if neighbor not in distance or distance[neighbor] > distance[current_point] + 1:
                    distance[neighbor] = distance[current_point] + 1
                    parent[neighbor] = current_point
                    queue.append(neighbor)
                    if self.grid[neighbor[0]][neighbor[1]] == 1:
                        return distance[neighbor]



