class Solution:
    def __init__(self) -> None:
        self.min_x = 0
        self.min_y = 0

    def solution(self, stdin: str) -> str:
        n = int(stdin.split('\n')[0])
        data = []
        for line in stdin.split('\n')[1:]:
            x, y = map(int, line.split())
            data.append((x, y))

        data.sort(key=lambda x: x[1])
        sorted_data = sorted(data, key=lambda x: x[0])

        self.min_x = sorted_data[0][0]
        self.min_y = sorted_data[0][1]

        for i in range(1, n):
            if sorted_data[i][0] >= sorted_data[i - 1][0] + self.min_y:
                self.min_y = sorted_data[i][1]

        return '\n'.join('{} {}'.format(x, y) for x, y in sorted_data)

