class Solution:
    def solution(self, stdin: str) -> str:
        result: List[int] = []
        n: int = int(stdin.split()[0])
        if n < 1 or n > 100:
            return ''

        for i in range(1, n + 1):
            c = stdin.split('\n')[i]
            c = c.split()
            if len(c) < 2 or len(c[0]) < 1 or len(c[1]) < 1 or len(c[1]) > 20:
                return ''

            result.append(c)

        if len(result) <= 1:
            return '0'

        count = 0
        possible_characters = {name: [] for name in result[0][0]}
        for c in result:
            char = c[0]
            possible_characters[char] += c[1:]

        for c in possible_characters:
            queue = deque([c])
            visited = {c: 1}
            while queue:
                curr_character = queue.popleft()
                if curr_character not in possible_characters:
                    continue
                for next_character in possible_characters[curr_character]:
                    if next_character not in visited:
                        queue.append(next_character)
                        visited[next_character] = 1
            count += len(visited)

        return str(count)

